<h1 class="Section4">
<a class="Section5" href="#" id="introduction">Introduction</a>
</h1>
<div class="Section6"><br><b>Ace </b>est un éditeur de code autonome écrit en JavaScript dont l'objectif est de créer un éditeur de code web qui correspond et étend les fonctionnalités, la convivialité et les performances des éditeurs natifs existants tels que TextMate, Vim ou Eclipse. Il peut être facilement intégré dans n'importe quelle page web et application JavaScript.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="installation-de-ace-v1-21-0">Installation de Ace v1.21.0</a>
</h1>
<div class="Section6"><br>Nous essayerons d'installer Ace dans notre environnement de développement. Ouvrir la page de téléchargement. Ouvrir la page des builds. Ouvrir la page des tags. Télécharger le fichier archive. Décompresser le fichier archive. Installer le fichier décompressé dans votre environnement de développement selon votre choix (/libs/ace/v1.21.0/src-min-noconflict).<br><br><div class="GSummary2"><div class="GSummary21 Summary4">
