</div><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-google-fonts-v0_ce-qu-il-faut-savoir" href="#utilisation-de-ace-v1-21-0">Ce qu'il faut savoir</a>
</h2><br>Il faut que le répertoire d'installation soit à la racine de votre fichier d'entrée (index.html).<br><br><h2 class="GTitle1 Title1">
<a class="Title2" id="utilisation-de-google-fonts-v0_programme-principal" href="#utilisation-de-ace-v1-21-0">Programme principal</a>
</h2><br><pre class="GCode1 Code1 AceCode" data-mode="html" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">&lt;!DOCTYPE html&gt;
&lt;html lang="en"&gt;
    &lt;head&gt;
        &lt;title&gt;AceJS | ReadyDev&lt;/title&gt;
    &lt;/head&gt;
    &lt;body&gt;

&lt;div id="editor"&gt;
//===============================================
#include &lt;stdio.h&gt;
//===============================================
int main(int _argc, char** _argv) {
    printf("Bonjour tout le monde.\n");
    return 0;
}
//===============================================
&lt;/div&gt;

        &lt;script src="./libs/ace/v1.21.0/src-min-noconflict/ace.js"&gt;&lt;/script&gt;
        
        &lt;script&gt;
            var lEditor = ace.edit("editor");
            lEditor.setOptions({
                theme: "ace/theme/monokai"
                , mode: "ace/mode/c_cpp"
                , maxLines: 20
                , fontSize: "16px"
            });                    
        &lt;/script&gt;
    &lt;/body&gt;
&lt;/html&gt;</pre><br><h2 class="GTitle1 Title1">
